description:
Taboo: Obsessions

Health-Medical Documentary hosted by Emma Chambers, published by National Geographic in 2012 - English narration


Information
------------------------------

Taboo: Obsessions
A love affair with balloons, a fetish for female bodybuilders, and a snuggle up to a shrunken head in bed... Taboo promises to be one of the strangest shows you'll see this year. Collectors reveal their obsessions, including London curiosity shop owner Viktor Wynd, whose store sells skeletons, alleged celebrity faeces and Russell Brand's hair to Jim's 'Noah's Ark' with 550 live animals, discover how some collectors' passions cross the line.

